import React, { useState, useEffect, useMemo } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import {buttonAdd,buttonEdit,buttonDelete} from '../styles/button.style';
import { Container } from '../styles/container.style';
import {
    StyledTable,
    Tr,
    Th,
    Td
} from '../styles/table.style';

const EmployeeList = (props) => {
    const [Employee, setEmployee] = useState([]);
    const fetchEmployees = async () => {
        const response = await axios.get('https://63bdda61e348cb076204aebb.mockapi.io/api/v1/employee-data').catch(err => console.log(err));
        if (response) {
            const employees = response.data;
            console.log("employees", employees);
            setEmployee(employees);
        }

    };
    return (
        <>
            <Container>
                <h1>List of Employees</h1>
                <StyledTable>

                        <thead>
                            <tr>
                                <th>First Name</th>
                                <th>Last Name</th>
                                <th>Age </th>
                                <th>Gender</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>Usmael</td>
                                <td>A</td>
                                <td>22</td>
                                <td>Male</td>
                            </tr>
                        </tbody>

                </StyledTable>
                <Link to="/add"> <buttonAdd>addEmployee</buttonAdd></Link>
                <Link to="/update"> <buttonAdd>UpdateEmployee</buttonAdd></Link>
            </Container>
        </>
    )
}

export default EmployeeList;
